      decimal CompWeight8 = 0m;
      decimal CompWeight9 = 0m;

      Decimal partWeight = 0.0m;

      /* Inputs.var_part1.Value */
      if (Inputs.var_part1.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part1.Value);
      }

      if (available_part)
      {

          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part1.Value, out partWeight);
          CompWeight1 = partWeight * Inputs.var_partqty1.Value;
      }


      /* Inputs.var_part2.Value */
      if (Inputs.var_part2.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part2.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part2.Value, out partWeight);
          CompWeight2 = partWeight * Inputs.var_partqty2.Value;
      }


      /* Inputs.var_part3.Value */
      if (Inputs.var_part3.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part3.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part3.Value, out partWeight);
          CompWeight3 = partWeight * Inputs.var_partqty3.Value;
      }

      /* Inputs.var_part4.Value */
      if (Inputs.var_part4.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part4.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part4.Value, out partWeight);
          CompWeight4 = partWeight * Inputs.var_partqty4.Value;
      }

      /* Inputs.var_part5.Value */
      if (Inputs.var_part5.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part5.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part5.Value, out partWeight);
          CompWeight5 = partWeight * Inputs.var_partqty5.Value;
      }

      /* Inputs.var_part6.Value */
      if (Inputs.var_part6.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part6.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part6.Value, out partWeight);
          CompWeight6 = partWeight * Inputs.var_partqty6.Value;
      }

      /* Inputs.var_part7.Value */
      if (Inputs.var_part7.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part7.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part7.Value, out partWeight);
          CompWeight7 = partWeight * Inputs.var_partqty7.Value;
      }

      /* Inputs.var_part8.Value */
      if (Inputs.var_part8.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part8.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part8.Value, out partWeight);
          CompWeight8 = partWeight * Inputs.var_partqty8.Value;
      }

      /* Inputs.var_part9.Value */
      if (Inputs.var_part9.Value != "")
      {
          available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part9.Value);
      }

      if (available_part)
      {
          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part9.Value, out partWeight);
          CompWeight9 = partWeight * Inputs.var_partqty9.Value;
      }


      /* Totals the individual component weights */
      Inputs.var_netweight.Value = CompWeight1 + CompWeight2 + CompWeight3 + CompWeight4 + CompWeight5 + CompWeight6 + CompWeight7 + CompWeight8 + CompWeight9;

      /* Used to display Netweight list incase verification is required */
      Inputs.var_weightlookup.Value = "1(" + CompWeight1.ToString() + ")" + " - 2(" + CompWeight2.ToString() + ")" + " - 3(" + CompWeight3.ToString() + ")" + " - 4(" + CompWeight4.ToString() + ")" + " - 5(" + CompWeight5.ToString() + ")" + " - 6(" + CompWeight6.ToString() + ")" + " - 7(" + CompWeight7.ToString() + ")" + " - 8(" + CompWeight8.ToString() + ")" + " - 9(" + CompWeight9.ToString() + ")";


      /* Returns Commodity Code from CSV */
      Inputs.var_commodity.Value = PCLookUp.DataLookup("TENUK_FG_MasterTable", "commodity_code", Inputs.var_fgnum.Value);


      /* If no commodity code is returned from the CSV file it checks the parts master table */
      string partclass = "";
      partclass = "";
      if (Inputs.var_commodity.Value == "")
      {
          UDMethods.GetPartClass(Context.CompanyID, Inputs.var_fgnum.Value, out partclass);
      }

			string commodityCode = "";
      /* As Part Class is used to assign Commodity Code */
      if ((Inputs.var_commodity.Value == "") && (partclass != ""))
      {
          bool result = UDMethods.GetPartClassCommodity(Context.CompanyID, partclass, out commodityCode);
				  if (result)
				  	Inputs.var_commodity.Value = commodityCode;
      }

      /* Verifies Commodity code exists in IComCode Table within Epicor */
      string commoditycheck = "";
      commoditycheck = "";
      if (Inputs.var_commodity.Value != "")
      {
					/* commodityCode is blank at this point */
 				  bool result = UDMethods.GetICommImportCode(Context.CompanyID, Inputs.var_commodity.Value, out commoditycheck);

      }

      if (Inputs.var_commodity.Value == "")
      {
					MessageBox.Show("The Configurator has been unable to determine the Commodity Code for the chosen configuration. Please contact the Operations department.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
					PageLeaveFunctions.SetNextInputPage(1);
					Args.Cancel = true;
      }


      if (Inputs.var_commodity.Value != commoditycheck)
      {

					MessageBox.Show("The Configurator has assigned a Commodity code that does not have a corresponding Epicor record, please contact the Operations department to correct this error.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
					PageLeaveFunctions.SetNextInputPage(1);
					Args.Cancel = true;


      }
      else if ((Inputs.var_commodity.Value != "") || (Inputs.var_commodity.Value == commoditycheck))
      {
          PageLeaveFunctions.SetNextInputPage(4);
      }

      /* ************************************************************************************************************************************************ */

      /* Pack Comment */

      string Mode = "";
      int CustID = 0;
      int OrderNum = 0;
      int QuoteNum = 0;
      string CustCountry = "";
      string CustName = "";
      string OTSID = "";
      bool OTS = false;
      int OTSCountry = 0;


      /* Determines Current Configuration Mode and order/quote specifics */
		  Mode = Context.Entity;
			CustID = 0; /* Set to Zero when not used for testing*/
			CustCountry = "";
      OrderNum = Context.OrderNumber;
			QuoteNum = Context.QuoteNumber;

      /* ********************************************************************************************************************************************************************************** */
      if (Mode == "Quote")
      {
					/* Retrieve details from Quote Header */
          bool result = UDMethods.GetQuoteHed(Context.CompanyID, QuoteNum, out CustID, out OTSID, out OTS);

          if (result)
          {
						Inputs.var_custid.Value = CustID;
          }

          /* Retrieves customer name using customer ID */
          result = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry);                   

					/* ************************************************************** */

          /* If a saved shipto address is specified gets country info */
          if (OTSID != "")
          {

              result = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
              result = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);

          }

					Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + QuoteNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
          Inputs.var_shipcountry.Value = CustCountry;

      }


     /* ********************************************************************************************************************************************************************************** */
     if (Mode == "Order")
     {
					/* Retrieve details from Order Header */
          bool result = UDMethods.GetOrderHed(Context.CompanyID, OrderNum, out CustID, out OTSID, out OTS);

          if (result)
          {
						Inputs.var_custid.Value = CustID;
          }

          /* Retrieves customer name using customer ID */
          result = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry);          

					/* ************************************************************** */

          /* If a saved shipto address is specified gets country info */
          if (OTSID != "")
          {

              result = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
							result = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);

          }

					Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + OrderNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
          Inputs.var_shipcountry.Value = CustCountry;

		 }

     /* ********************************************************************************************************************************************************************************** */
     if (Mode == "PcStatus")
     {

         Inputs.var_orderdtl.Value = "Mode: " + Mode;
         /* Inputs.var_shipcountry.Value = "Albania". */

         Inputs.var_custid.Value = 11131;

     }

     /* ********************************************************************************************************************************************************************************** */

     string palletlookup = "";

     palletlookup = "";

     /* Finds Pallet lookup from csv based on Shipping country*/
     palletlookup = PCLookUp.DataLookup("CountryPalletList", "pallet_type", Inputs.var_shipcountry.Value);

     if (palletlookup != "")
     {
         Inputs.var_palletlookup.Value = palletlookup + "_Lookup";
         Inputs.var_packcomment.Value = PCLookUp.DataLookup("CountryPalletList", "default_message", Inputs.var_shipcountry.Value);
     }

     if (palletlookup == "") { Inputs.var_palletlookup.Value = "All_Lookup"; }

}

/* ********************************************************************************************************************************************************************************** */

/* Determine the gate operation cycle time based on FG Number */


/* Find gate cycle_time_selector */
string gatecycletimelookup = "";
gatecycletimelookup = "std";

/* Returns cycletime from Master FG List CSV */

string gatecycletimeselector = "";

gatecycletimeselector = gatecycletimelookup + "_op_time_min";


Inputs.var_op10time.Value = System.Convert.ToDecimal( PCLookUp.DataLookup("TENUK_FG_MasterTable", gatecycletimeselector, Inputs.var_fgnum.Value) );
